import React, { Component } from 'react'
import Menu from './Menu'

export class ShowContact extends Component {
  render () {
    return (
      <main>
          {this.props.cont.map(el => (
              <Menu onShowCont={this.props.onShowCont} key ={el.id} item={el}/>
          ))}
      </main>
    )
  }
}

export default ShowContact
